import React, { useState } from 'react';
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// import { faHome, faStore, faPaw, faInfoCircle, faShoppingBag, faUserCircle } from '@fortawesome/free-solid-svg-icons';

const Header = () => {
  const [showMenu, setShowMenu] = useState(false);

  const toggleMenu = () => {
    setShowMenu(!showMenu);
  };

  return (
    <header>
      <nav className="navbar">
        <div className="logo">
          <img src="images/logo/lo" className="logi" alt="PAWS VEDA Logo" />
        </div>
        <div className="add-icon">
          <p><b>P</b></p>
          <span style={{ fontSize: "20px" }}>&#128062;</span>
          <p><b>aws </b></p>
          <p><b>Veda</b></p>
        </div>
        <div className="nav-search">
          <img src="images/WhatsApp Image 2024-05-16 at 12.14.57 AM.jpeg" style={{ height: "20px", margin: "0 20px" }} alt="WhatsApp" />
          <input placeholder="Search" className="search-input" />
          <img src="images/seach.jpeg" style={{ height: "20px", margin: "5px 15px" }} alt="Search Icon" />
        </div>
        <div className="icon">
          <ul>
            <li><FontAwesomeIcon icon={faShoppingBag} /><span className="sr-only">Shopping Bag</span></li>
            <li><FontAwesomeIcon icon={faUserCircle} /><span className="sr-only">User Profile</span></li>
          </ul>
        </div>
        {/* Responsive menu button */}
        <div className="responsive-menu" onClick={toggleMenu}>
          <FontAwesomeIcon icon={faBars} />
        </div>
      </nav>
      {/* Responsive menu */}
      {showMenu && (
        <div className="header1">
          <a className="h" href="#home"><FontAwesomeIcon icon={faHome} /> Home</a>
          <a className="h" href="#shop"><FontAwesomeIcon icon={faStore} /> Shop</a>
          <a className="h" href="#PetCare"><FontAwesomeIcon icon={faPaw} /> Pet care</a>
          <a className="h" href="#pet-accessories"><FontAwesomeIcon icon={faPaw} /> Pet Accessories</a>
          <a className="h" href="#about"><FontAwesomeIcon icon={faInfoCircle} /> About</a>
        </div>
      )}
    </header>
  );
}

export default Header;
